class Demo7ChildComp extends Component
{
    constructor(props)
    {
        super(props)
    }

    render()
    {
        return (<div style={{border:"1px dashed black", backgroundColor:"lightblue", width:"150px"}}>
            Name: {this.props.name}
            <br/>
        </div>)
    }

}
export default Demo7ChildComp
